import React from "react";

const OutputWindow = ({ outputDetails }) => {

  const getOutput = () => {
    if (!outputDetails) return null;

    let statusId = outputDetails?.status?.id;

    if (statusId === 6) {
      // compilation error
      return (
        <pre className="px-2 py-1 font-normal text-xs text-red-500">
          {(outputDetails?.compile_output)}
        </pre>
      );
    } else if (statusId === 3) {
      return (
        <pre className="px-2 py-1 font-normal text-xs text-green-500">
          {outputDetails?.stdout !== null && outputDetails?.stdout !== undefined
            ? `${atob(outputDetails.stdout)}`
            : null}
        </pre>
      );
    } else if (statusId === 5) {
      return (
        <pre className="px-2 py-1 font-normal text-xs text-red-500">
          {`Time Limit Exceeded`}
        </pre>
      );
    } else {
      return (
        <pre className="px-2 py-1 font-normal text-xs text-red-500">
          {atob(outputDetails?.stderr)}
        </pre>
      );
    }
  };

  return (
    <div>
     <h2 className="max-md:max-w-full">Output</h2>
      <div className="w-full h-56 mt-4 bg-neutrals-neutrals800 rounded-xl text-white font-normal text-sm overflow-y-auto">
        {getOutput()}
      </div>
    </div>
  );
};

export default OutputWindow;
